INSERT INTO `areas` (`id`, `name`, `comment`, `regionId`, `zoneNum`, `startZoneId`, `image`, `sx`, `sy`, `wx`, `wy`, `eventId`)
VALUES
	(1,'Catacomb','An underground graveyard\nthat has fallen into ruin.',5,1,50101,0,0,0,0,0,0),
	(2,'Darkwood Forest','A dangerous woodland\nknown as a den of thieves.',5,1,50201,1,80,103,64,64,0),
	(3,'Chestnut Grove','Hunters and woodcutters\nsojourn in this village.',5,1,50301,4,194,154,64,64,0),
	(4,'Bone Meadow','A great war here a century\npast claimed many lives.',5,5,50401,2,34,183,64,64,0),
	(5,'Blackhill','Village that fills the\ngranaries of Uragan.',5,5,50501,5,113,304,64,64,0),
	(6,'Lake Vandassia','Reservoir serving Uragan\nand the Lowlands.',5,5,50601,3,200,354,64,64,0),
	(7,'Ubo Abo Bog','A peat bog dotted with\ndeep, murky pools.',7,5,70101,6,192,49,64,64,0),
	(8,'Zam Bam Jungle','Thousand-year-old trees\nrule this vast jungle.',7,5,70201,7,223,160,64,64,0),
	(9,'Zuo\'O','An Ape tree-city linked\nby soaring bridges.',7,5,70301,8,44,231,64,64,0),
	(10,'Fort Gad Rad','Seat of the Ape chief,\nhewn from a great tree.',7,5,70401,9,188,337,64,64,0),
	(11,'Infernal Vale','Scorched trees and lava\ncover this blast crater.',9,5,90101,10,202,64,64,64,0),
	(12,'Abyss Gate','A massive bronze gate\nguards the mines beyond.',9,5,90201,11,106,71,64,64,0),
	(13,'Ghost Mines','Tracks crisscross this\nlong-abandoned mine.',9,5,90301,12,7,118,64,64,0),
	(14,'Firstforge','The great dwarf craftsmen\nwork their wonders here.',9,5,90401,13,61,183,64,64,0),
	(15,'Hellfire Gorge','An iron bridge spans the\nriver of lava below.',9,5,90501,14,148,229,64,64,0),
	(16,'Bilgen','This ore trading town\nbustles with miners.',9,5,90601,15,244,238,64,64,0),
	(17,'Steamhalls','Steam pipes weave through\nthis factory town.',9,5,90701,16,183,318,64,64,0),
	(18,'Clockwork Destiny','Vault housing the gears\nof the great turbine.',9,5,90801,17,87,359,64,64,0),
	(19,'Gadju Station','With the suspension of regular service, this station has become a junkyard.',8,5,80101,18,100,384,64,64,0),
	(20,'Stoolworks','The goblin army maintains this poisonous toadstool plant.',8,5,80201,19,236,334,64,64,0),
	(21,'Puzappa Outskirts','Countless caves dug into the side walls of the tunnels serve as dwellings in this sprawling slum.',8,5,80301,20,154,295,64,64,0),
	(22,'Puzappa Underfast','The elder statesmen who wield military authority reside here, in the Puzappa center.',8,5,80401,21,17,229,64,64,0),
	(23,'Zeroben Cages','A prison of cages hung from the ceiling high above.',8,5,80501,22,88,170,64,64,0),
	(24,'Lake Gotep','Water of a sublime greenish hue fills this underground lake.',8,5,80601,23,176,140,64,64,0),
	(25,'The Great Temple','A cold sun wrought from giant glowing letters illuminates this limestone cavern.',8,5,80701,24,215,74,64,64,0),
	(26,'The Giants\' Stair','Ruins left by an ancient civilization of giants. Massive stone stairs lead upward to the surface lands.',8,5,80801,25,115,49,64,64,0),
	(27,'Yutara Fens','A verdant wetland home to abundant wildlife.',10,5,100101,26,220,405,64,64,0),
	(28,'Torveau Ruins','These sacred sprawling ruins are the hatching grounds of all lizardmen.',10,5,100201,27,87,377,64,64,0),
	(29,'Fleshflower Field','The carnivorous flowers here are a staple crop of the people of Orvista.',10,5,100301,28,177,312,64,64,0),
	(30,'Guivre Swamp','The legendary dragon Guivre sleeps within.',10,5,100401,29,42,257,64,64,0),
	(31,'The Fern Sea','A deep forest of mighty ferns.',10,5,100501,30,101,225,64,64,0),
	(32,'Gates of Gala','A giant stone gate on the outskirts of Gala.',10,5,100601,31,104,137,64,64,0),
	(33,'Heart of Gala','Stone shops and houses line the streets of the capital of the lizardmen.',10,5,100701,32,85,60,64,64,0),
	(34,'The Dragon Pits','An arena where the brave can display their might.',10,5,100801,33,224,54,64,64,0),
	(35,'Skylark Village','Samurai train in this quiet, well-kept village.',6,5,60101,34,205,375,64,64,0),
	(36,'Mantra Falls','Master samurai travel to these falls to attain inner peace and strength.',6,5,60201,35,30,337,64,64,0),
	(37,'Kaguya Forest','Ninja haunt the dense bamboo stands of this perilous forest.',6,5,60301,36,112,269,64,64,0),
	(38,'The Sakura Gardens','Sakura bloom year-round in this garden, a favored retreat for the nobles of Shi-en Castle.',6,5,60401,37,223,241,64,64,0),
	(39,'Shi-en Castle','A massive castle that exemplifies the East Midlands.',6,5,60501,38,106,178,64,64,0),
	(40,'Shi-en Castle Sanctum','The heart of the castle has stood for many thousand years.',6,5,60601,39,192,156,64,64,0),
	(41,'Ancient Cloister','This long stairway built outside the castle seems to climb forever.',6,5,60701,40,85,64,64,64,0),
	(42,'Twilight Knoll','The summit of this legendary hill marks the site of the samurai\'s final test.',6,5,60801,41,219,75,64,64,0),
	(43,'Everdark Forest','A dense conifer forest heavy with untrodden snow.',4,5,40101,42,0,0,64,64,0),
